import React from "react";

const kontakt = () => {
  return (
    <div className='dummy'>
      <h1 className='dummyText'>Anmelden</h1>
      <form>
        <div class='six columns'>
          <input class='button-primary' type='submit' value='Submit'></input>
        </div>
      </form>
    </div>
  );
};

export default kontakt;
